INSERT INTO `delivery_policy` (`id`, `title`, `content`, `created_at`, `updated_at`) VALUES
(1, 'DELIVERY POLICIESsv', '<p>At Vivaadh, we are committed to delivering your orders in a timely and efficient manner. Please read the details of our delivery process below:</p><h4><strong>1. Delivery Locationsfasf</strong></h4><ul><li>We deliver across India to both urban and rural locations.</li><li>International delivery is available to selected countries. Shipping rates and delivery times for international orders will be calculated at checkout.</li></ul><h4><strong>2. Delivery Timeframes</strong></h4><ul><li><strong>Standard Products</strong>:</li><li>Orders are typically processed and shipped within <strong>2–5 business days</strong> of confirmation.</li><li>Delivery time depends on the destination and generally ranges between <strong>5–10 business days</strong> for domestic orders.</li><li><strong>Custom Orders</strong>:</li><li>Custom-made products, such as machine embroidery or T-shirt printing, require additional production time. Delivery time may vary between <strong>10–15 business days</strong> depending on the complexity of the customization.</li><li>During peak seasons or holidays, processing and delivery times may be slightly extended.</li></ul><h4><strong>3. Shipping Charges</strong></h4><ul><li>Shipping charges, if applicable, will be displayed at checkout before payment.</li></ul><h4><strong>4. Order Tracking</strong></h4><ul><li>Once your order is shipped, a tracking number will be shared via email or SMS to help you track the status of your delivery.</li></ul><h4><strong>5. Failed Deliveries</strong></h4><ul><li>If a delivery attempt fails due to incorrect shipping details provided by the customer, additional shipping charges may apply for re-delivery.</li><li>Orders that are unclaimed or refused upon delivery will not be eligible for refunds.</li></ul><h4><strong>6. Delayed or Lost Shipments</strong></h4><ul><li>If your order is delayed beyond the estimated timeframe, please contact our support team at [vivaadhgroup@gmail.com]</li><li>In the rare event of a lost shipment, we will either replace the product or issue a full refund after confirmation with the courier service.</li></ul><h4><strong>7. International Deliveries</strong></h4><ul><li>Customs duties, taxes, or import fees (if applicable) are the responsibility of the customer. Please check your country’s policies before placing an order.</li></ul><h4><strong>8. Contact Us</strong></h4><p>For delivery inquiries or issues, reach out to us at:</p><p><strong>Email</strong>: [vivaadhgroup@gmail.com]</p><p><strong>Phone</strong>: [9361726968]</p>', '2025-03-25 05:13:27', '2025-03-25 05:13:27');
INSERT INTO `epr_compliance` (`id`, `title`, `content`, `created_at`, `updated_at`) VALUES
(1, 'EPR Compliance', '<p>At Vivaadh, we value your trust and are committed to protecting your personal information. This Privacy Policy explains how we collect, use, disclose, and safeguard your data when you interact with our website, products, or services.</p><h4><strong>1. Information We Collect</strong></h4><p>We may collect the following types of information:</p><ul><li><strong>Personal Information</strong>: Name, email address, phone number, shipping address, and billing details when you place an order or contact us.</li><li><strong>Payment Information</strong>: Payment card details or other payment method data (processed securely via third-party payment gateways).</li><li><strong>Usage Data</strong>: Information about how you use our website, including IP address, browser type, and browsing patterns, collected via cookies or similar technologies.</li><li><strong>Order Details</strong>: Information about your purchases, including customizations for machine embroidery or T-shirt printing.</li></ul><h4><strong>2. How We Use Your Information</strong></h4><p>We use the information we collect for the following purposes:</p><ul><li>To process and fulfill your orders, including shipping and delivery.</li><li>To communicate with you about your orders, inquiries, or requests.</li><li>To improve our website, products, and customer experience.</li><li>To send promotional offers, newsletters, or updates (with your consent).</li><li>To comply with legal obligations and prevent fraudulent activities.</li></ul><h4><strong>3. Data Sharing and Disclosure</strong></h4><p>We do not sell or rent your personal data. However, we may share your information with:</p><ul><li><strong>Service Providers</strong>: Shipping companies, payment gateways, or IT service providers to process and deliver your orders.</li><li><strong>Legal Authorities</strong>: If required by law or to protect our legal rights.</li><li><strong>Analytics Providers</strong>: To analyze website performance and user behavior (e.g., Google Analytics).</li></ul><h4><strong>4. Data Security</strong></h4><p>We implement robust security measures to protect your personal information, including:</p><ul><li>Data encryption during transmission.</li><li>Secure servers and firewalls to prevent unauthorized access.</li><li>Regular monitoring and updates to our security protocols.</li></ul><p>Despite our efforts, no online platform can guarantee 100% security.</p><h4><strong>5. Cookies and Tracking Technologies</strong></h4><p>We use cookies to enhance your browsing experience. These may include:</p><ul><li><strong>Essential Cookies</strong>: Necessary for the website to function properly.</li><li><strong>Performance Cookies</strong>: Help us analyze website usage.</li><li><strong>Advertising Cookies</strong>: Used to deliver relevant ads to you.</li></ul><p>You can manage or disable cookies through your browser settings.</p><h4><strong>6. Your Rights</strong></h4><p>You have the following rights regarding your personal data:</p><ul><li><strong>Access and Correction</strong>: Request access to or correction of your personal information.</li><li><strong>Deletion</strong>: Request deletion of your data, subject to legal and operational requirements.</li><li><strong>Opt-out</strong>: Unsubscribe from promotional emails or opt-out of data collection through cookies.</li></ul><p>To exercise these rights, contact us at [vivaadhgroup@gmail.com/ 9361726968].</p><h4><strong>7. Legal Compliance</strong></h4><p>This Privacy Policy is governed by Indian laws. By using our services, you consent to the collection and use of your information as outlined in this policy.</p><h4><strong>8. Updates to This Policy</strong></h4><p>We may update this Privacy Policy periodically. Changes will be communicated through our website, and the updated policy will take effect immediately upon posting.</p><h4><strong>9. Contact Us</strong></h4><p>For questions or concerns regarding this Privacy Policy, please contact us at:</p><p><strong>Email</strong>: [[vivaadhgroup@gmail.com]</p><p><strong>Phone</strong>: [9361726968]b</p>', NULL, '2025-04-01 00:19:31');
